import React from 'react';
import './App.css';
import {Link} from 'react-router-dom';
import Button from 'react-bootstrap/Button';

function Nav() {
  return(
    <nav>
        <h3>Logo</h3>
        <ui className="nav-links">
            <Link to='/about'>
              <Button variant="secondary">About</Button>
            </Link>
            <Link to='/shop'>
                <li>Shop</li>
            </Link>
        </ui>
    </nav>
  );
};


export default Nav;
